import React from 'react';
import isLoading from '@hocs/isLoading';
import {withTranslation } from 'react-i18next';
import {
  SetupWrapper,
  SetupCard
} from './setup.style';
import { withToastManager } from 'react-toast-notifications';


const SetupPageContent = props => {
    const {name} = props;

    return (

        <SetupWrapper data-testid="welcome-wrapper">
            <SetupCard className="card">
                <h3>
                    Welcome, <span>{name}</span>
                </h3>

                <div style={{}}>
                    <h5>to Internet Wake-Up Call.</h5>
                </div>
                
                <div style={{width:"60%"}}>
                    We dynamically adjust your wake up time based on traffic and weather. Click below to setup your call!
                </div>

                <br/>

                <div>
                    <button>Setup My Call</button>
                </div>

            </SetupCard>
        </SetupWrapper>
    );
};

export { SetupPageContent };
export default withTranslation()(
  isLoading(withToastManager(SetupPageContent))
);
